Auratus X is a Script Hub that takes all the scripts from the synapse, sirhurt, sirmeme script channel and implants it in here. With a click of a button you can execute any of them. Plus when the server gets deleted it still works! DM me if you have any suggestions/bug reports. Also if any scripts dont work, dm me and I'll fix it or remove it.
Latest Version 1.2.1

The Default Keybind to open the Hub is Z
you can change it in the script
scroll down and you'll see the settings for it

IF IT DOESNT LOAD JUST GIVE IT 5-20 Secs because it has lots of scripts

Features:
+Over 270+ Scripts
+Scripts from Synapse Discord
+Scripts from Sirhurt Discord
+Scripts from Sirmeme Website
+Scripts run 2-4x more smoothly/faster!
+Any script executed with the click of a button
+Choose your open/close keybind option below the Enormous Text
+Search bar for each tab
+Nice UI
+Best Free Script Hub??
+Updating every 1-2 days, mostly every 1 day. Rarely 2

 
Note:Theres really no point in going to the source, Its all obfuscated and shit. Use this script instead for auto update.
 
